import './styles.css';
import React from 'react'
import * as selectors from '../../reducers'
import { connect } from 'react-redux';

const Baby = ({babies,count}) => (
        <div className="container">
            <div className="baby">
                <select id="B" name="babies">
                    {babies.map(baby => (
                    <option value={baby[Object.keys(baby)[1]]+" "+baby[Object.keys(baby)[2]]}>{baby[Object.keys(baby)[1]]+" "+baby[Object.keys(baby)[2]]}</option> 
                    ))}
                </select>
            </div>
        </div>
    )

export default connect(
    state => ({
        babies: selectors.getAllBabies(state)
    }),
    undefined
)(Baby)
